import React from "react";
import { Navbar } from "react-bootstrap";

function Menu() {
  return (
    <Navbar bg="dark" variant="dark">
      <Navbar.Brand href="#home">CoronaVirus Tracker</Navbar.Brand>
    </Navbar>
  );
}

export default Menu;
